  \"2016-04-19T02:28:42.693964\",\n\t\"name\": \"kirwan-institute-opportunity-map-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This 2013 dataset includes information
  at the block group-level for the 5-county Austin metro area. Economic, educational,
  housing, mobility, and environmental indicators are calculated for each block group
  to provide a comprehensive opportunity index score. This score reflects \"opportunity\"
  in the area, defined as a situation or condition that places individuals in a position
  to be more likely to succeed or excel. This data was collected and calculated by
  the Kirwan Institute, with collaboration from Green Doors and various community
  partners, and is compiled in  \"Geography of Opportunity in Austin\" (http://www.greendoors.org/programs/docs/Geography-of-Opportunity-Austin-2013.pdf#page=43).
  The data can be viewed in an interactive map form here: http://www.arcgis.com/home/webmap/viewer.html?webmap=5db08646b03547abab85aec0a3592fb7.
  The data is also available in shapefile format for use in ESRI GIS mapping applications
  here: https://data.austintexas.gov/Neighborhood/Kirwin-Opportunity-Map/3ns6-m3cy.\",\n\t\"license_title\":
